import React from "react";

const App = () => {
  function CountDisplay() {
    const count = 0;
    return <div>The count is : {count}</div>;
  }
  function Countter() {
    const setCount = () => {};
    const increment = () => setCount((c) => c + 1);
    return (
      <button
        onClick={increment}
        className="p-4 font-semibold text-white bg-purple-500 rounded-lg"
      >
        Increment count
      </button>
    );
  }
  return (
    <div>
      <CountDisplay></CountDisplay>
      <Countter></Countter>
    </div>
  );
};

export default App;
